import React from 'react';
import './shopping-cart-table.css';

const ShoppingCartTable = ({ items, total, onIncreas, onDecreas, onDelete }) => {
  return (
    <div className="shopping-cart-table">
      <h2>Your Order</h2>
      <table className="table">
        <thead>
          {
            items.map()
          }
        </thead>
      </table>

      <div className="total">
        Total: ${total}
      </div>
    </div>
  );
};

export default ShoppingCartTable;
